<h1>Rope Track</h1>
<p><b>Location</b>: Trees at Komijnepad
<br><b>Number of participants</b>: 8 participants per team
<br><b>Playing time</b>: 20 minutes
<br><b>Penalties</b>: N/A</p>

<h2>How to play</h2>
<ol>
<li>Travel the ropeway from A to B.</li>
<li>All 8 team members have to complete the rope course.</li>
<li>Assistance from/by other team members is allowed.</li>
<li>It is also allowed to get off at each tree and then climb back into the rope for the next part.</li>
</ol>
<br><p>Bonus points can be earned if (all) team members have completed the rope course twice. This is only allowed/possible if all team members have completed the rope course 1x.</p>

